var vidMenuContainer = "#videoList";
var l = $("#listofvideo");
function getVidMenu(vidSrcList) {
 
    var h = "", editIcons = "<ul class='controll'></Ul>";

    $.each(vidSrcList, function (i) {
      
        h += "<li class='thumb-main'><div class='checkbox'> <div>"

        if (this.sourcetype == 0)
            h += "</div></div> <div class='thumb' onclick=\"play('" + this._id + "')\" ><img alt='' width='60' height='60' class='vidSS-Size' src='" + this.t + "' onError=\"javascript:onImgError(this);\"/></div>";

        if (this.sourcetype == 1)
            h += "</div></div> <div class='thumb' onclick=\"play('" + this._id + "')\" ><img alt='' width='60' height='60' class='vidSS-Size' src='" + this.t + "' onError=\"javascript:onImgError(this);\"/><span class='YTimg'></span></div>";

        if (this.sourcetype == 2)
            h += "</div></div> <div class='thumb' onclick=\"play('" + this._id + "')\" ><img alt='' width='60' height='60' class='vidSS-Size' src='" + this.t + "' onError=\"javascript:onImgError(this);\"/><span class='Timelineimg'></span></div>";


        h += "<div title='" + this.title + "'class='title' onclick=\"ViTagUI.play('" + this._id + "')\">" + this.title + "</div>";
      
        h += "<div class='details'>" + this.desc + "</div>";
        h += editIcons;
        h += "</li>";
    });
    return h;
}
play = function (ID) {
    ViTag.play(ID);
}


function onImgError(o) {
    var s = "data:image/png;base64,";
    o.src = s;
};
function createVidMenu(vidSrcList) {

    var $vl = $(vidMenuContainer), vidEle = "<li>No video found</li>";
    $(vidMenuContainer).children().remove("li");
    if (vidSrcList && vidSrcList.length > 0) {
        vidEle = getVidMenu(vidSrcList);
    }
    $vl.prepend(vidEle);
}
 
